import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Home from './Pages/home/Home.jsx';
import Introduction from "./Pages/introduction/Introduction.jsx";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path='introduction' element={<Introduction />} />
          <Route path='chapter1' element={<Introduction />} />
          <Route path='chapter2' element={<Introduction />} />
          <Route path='chapter3' element={<Introduction />} />
          <Route path='chapter4' element={<Introduction />} />
          <Route path='chapter5' element={<Introduction />} />
          <Route path='chapter6' element={<Introduction />} />
          <Route path='chapter7' element={<Introduction />} />
          <Route path='chapter8' element={<Introduction />} />
          <Route path='chapter9' element={<Introduction />} />
          <Route path='chapter10' element={<Introduction />} />
          <Route path='chapter11' element={<Introduction />} />
          <Route path='chapter12' element={<Introduction />} />
          <Route path='chapter13' element={<Introduction />} />


        </Routes>
      </BrowserRouter>
    </div>
  );
}
export default App;
